# The robot description defines the generalized coordinates and how to map those
# to the underlying URDF dofs.

api_version: 1.0

# Defines the generalized coordinates. Each generalized coordinate is assumed
# to have an entry in the URDF.
# Lula will only use these joints to control the robot position.
cspace:
    - a1_joint
    - a2__joint
    - a3_joint
    - a4_joint
    - a5_joint
    - claw_z_joint
default_q: [
    0.0,-0.0027,-0.0009,0.0099,0.01,-0.0
]

acceleration_limits: [
   10,10,10,10,10,10
]

jerk_limits: [
   10000,10000,10000,10000,10000,10000
]

# Most dimensions of the cspace have a direct corresponding element
# in the URDF. This list of rules defines how unspecified coordinates
# should be extracted or how values in the URDF should be overwritten.

cspace_to_urdf_rules:
    - {name: a1_piston_rod_joint, rule: fixed, value: 0.0002}
    - {name: a2_piston_joint, rule: fixed, value: 0.0003}
    - {name: a2_link_joint, rule: fixed, value: -0.0008}
    - {name: a1_piston_rod_prisjoint, rule: fixed, value: 0.0011}
    - {name: a2_piston_rod_joint, rule: fixed, value: 0.0011}
    - {name: a3_piston_rod_joint, rule: fixed, value: 0.0}
    - {name: a2_piston_rod_link_joint, rule: fixed, value: 0.0008}
    - {name: claw_x_joint, rule: fixed, value: -0.064}
    - {name: claw_y_joint, rule: fixed, value: 0.0085}
    - {name: claw_l_joint, rule: fixed, value: 0.0}
    - {name: claw_r_joint, rule: fixed, value: 0.0}
    - {name: claw_piston_rod_joint, rule: fixed, value: -1e-04}
    - {name: claw_piston_joint, rule: fixed, value: 0.0}

# Lula uses collision spheres to define the robot geometry in order to avoid
# collisions with external obstacles.  If no spheres are specified, Lula will
# not be able to avoid obstacles.

